import React from "react";

function Payment() {
  return (
    <div className="d-flex flex-column">
      <div className="p-2">
        <div className="d-flex flex-column">
          <div class="p-2">
            <h5>Address</h5>
          </div>
        </div>
      </div>
    </div>
  );
}
export default Payment
